import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [userdata, setUserData] = useState({
    id: '',
    name: '',
    email: '',
    phone: '',
    password: '',
  });
  const [housedata, setHouseData] = useState([
    {
      id: '',
      name: '',
      pic: '',
      price: '',
      size: '',
      desc: '',
    },
  ]);
  //connecting to server
  useEffect(() => {
    fetch('http://localhost:8000/')
      .then((res) => res.json())
      .then(
        (result) => {
          console.log(result);
          setHouseData(result);
          console.warn(housedata);
        },
        (error) => {
          console.log(`Error occured: ${error}`);
        }
      );
  }, []);
  return (
    <div>
      {housedata.map((h) => {
        <div style={{ border: '1px solid black' }}>
          <h3>{h.name}</h3>
          <img alt={h.name} src={h.pic} />
          <p>Price: {h.price}</p>
          <p>Size: {h.size}</p>
          <p>{h.desc}</p>
        </div>;
      })}
    </div>
  );
}

export default App;
